import React from 'react';
import { Link } from 'react-router-dom';
import './Login.css';
import bodyBuilderImage from '../assets/bodybuilder.png'; 

const LoginPage = () => {
  return (
    <div className="auth-container">
      <div className="auth-left">
        <img src={bodyBuilderImage} alt="Body Builder" className="auth-image" />
        <h2>Welcome back to Fitness Freak</h2>
      </div>
      <div className="auth-right">
        <h2>Login</h2>
        <input type="email" placeholder="Email" />
        <input type="password" placeholder="Password" />
        <button>Login</button>
        <p>
          Don't have an account? <Link to="/signup">Create new</Link>
        </p>
      </div>
    </div>
  );
};

export default LoginPage;
